            <h1>This is Home Page</h1>
            <p>Lorem ipsum dolor, sit amet consectetur adipisicing elit. Inventore adipisci sequi voluptas recusandae deleniti numquam ducimus cum soluta, obcaecati tempora voluptatem cupiditate dolore. Fugiat dolores aspernatur id animi doloribus dignissimos?</p>
        </div>
        </>
    )
}

export default Home;
